void bongo_drawBackground() {
  ST7735_FillScreen(ST7735_BLACK);
  ST7735_DrawImage(0, 0, BONGO_WIDTH, BONGO_HEIGHT, bongo_bg);
}

void bongo_drawLeftHand(int8_t side) {
  ST7735_DrawImage(
    BONGO_LEFT_OFFSET_X,
    BONGO_LEFT_OFFSET_Y,
    BONGO_LEFT_WIDTH,
    BONGO_LEFT_HEIGHT,
    side ? bongo_left_up : bongo_left_down
  );
}

void bongo_drawRightHand(int8_t side) {
  ST7735_DrawImage(
    BONGO_RIGHT_OFFSET_X,
    BONGO_RIGHT_OFFSET_Y,
    BONGO_RIGHT_WIDTH,
    BONGO_RIGHT_HEIGHT,
    side ? bongo_right_up : bongo_right_down
  );
}

